# 密文和密钥
ciphertext = ""
key = "PRINCE"

# 将密钥扩展到与密文等长
key_bytes = [ord(c) for c in key]
key_length = len(key)

# 将密文转换为字节
cipher_bytes = [int(ciphertext[i:i+2], 16) for i in range(0, len(ciphertext), 2)]

# 对每个字节进行解密 (XOR)
plaintext_bytes = [(cipher_bytes[i] ^ key_bytes[i % key_length]) for i in range(len(cipher_bytes))]

# 将解密后的字节转换为字符
plaintext = ''.join(chr(b) for b in plaintext_bytes)

print(plaintext)
